import React from "react";
import Contact from "./Contact";
import About from "./About";
import {Route, Switch} from 'react-router-dom';

const App = () =>{
     return(
        <>
            <Switch>
                <Route path='/' element={About}/>
            </Switch>
        </>
     )
}

export default App;
